import React from 'react';
import ReturndAsh from './Dash';
import './Loading.css';
import Home from '../Hm/Main';
import { auth } from '../firebase';
import BarLoader from 'react-spinners/BarLoader';

import { useNavigate } from 'react-router-dom';

export default function AdMindAsh() {

 const user = auth.currentUser;
 const navigation = useNavigate();

 const [loading, setLoading] = React.useState(true);
 const [people, setPeople] = React.useState(null);

 React.useEffect(() => {

  const data = window.localStorage.getItem('ACTIVE');
  setPeople(JSON.parse(data));

  // setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 7600);

  people === true ? navigation('/dash') : navigation('/');

 }, []);

 return (
  <div>
   {loading && <div className='App-loading'></div>}
   {loading && <div className='App-Icon'>
    <BarLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />
   </div>}

   <>
    {people && <ReturndAsh />}
   </>
  </div>
 );
};
